def dbEngines(lang:int):
    data = dbe_data[lang]
    output = [
        {
            "date": "2012-11-01",
            "value": data["data"][0]
        },
        {
            "date": "2012-12-01",
            "value": data["data"][1]
        }
    ]
    cursor = 2


    for year in range(2013, 2022):
        for month in range(1, 13):
            date_list = [str(year), str(month).zfill(2), "01"]
            date = "-".join(date_list)

            output.append({
                "date": date,
                "value": data["data"][cursor]
            })
            cursor += 1

    
    for month in range(1, 12):
        date_list = [str(2022), str(month).zfill(2), "01"]
        date = "-".join(date_list)

        output.append({
            "date": date,
            "value": data["data"][cursor]
        })
        cursor += 1

    return {
        "name":data["name"],
        "history":output
    }


print(dbEngines(4))